import React, { useContext } from 'react';
import PlanetsContext from '../context/PlanetsContext';

function Selector() {
  const { handleSelect } = useContext(PlanetsContext);
  return (
    <div className="select is-primary is-rounded is-medium">
      <select
        data-testid="column-filter"
        id="method"
        onChange={ handleSelect }
      >
        <option className="option" value="population">Population</option>
        <option className="option" value="orbital_period">Orbital_period</option>
        <option className="option" value="diameter">Diameter</option>
        <option className="option" value="rotation_period">Rotation_period</option>
        <option className="option" value="surface_water">Surface_water</option>
      </select>
    </div>
  );
}

export default Selector;
